// Generated by CoffeeScript 1.9.1

/*
	For /signup form page

	Dependencies:
		JQeury
		CryptoJS
 */

(function() {
  $("#login").submit(function(e) {
    var data;
    e.preventDefault();
    data = {
      email: $("[name='email']").val(),
      password: CryptoJS.SHA256($("[name='password']").val()).toString(CryptoJS.enc.Hex)
    };
    return $.ajax({
      url: "/login",
      type: "POST",
      ajax: "true",
      data: JSON.stringify(data),
      cache: false,
      contentType: "application/json",
      processData: false,
      success: function(res) {
        return $("#test").html(res);
      },
      error: function(res) {
        return $("#test").html("Error!");
      }
    });
  });

}).call(this);
